import React, {useState, useEffect, Component} from 'react';
import db from './firebase';
import ReactDOM  from 'react-dom';
import {collection, getDocs} from 'firebase/firestore';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../node_modules/bootstrap/dist/js/bootstrap.js'
import { BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import Teaching from './Components/Teaching';
import Non_Teaching from './Components/Non_Teaching';
import { render } from '@testing-library/react';

export default class App extends Component{
  render(){
    return (
      <Router>
        <div className="App">
          <ul>
            <li>
              <Link to="/">Teaching</Link>
            </li>
            <li>
              <Link to="/Non_Teaching">Non Teaching</Link>
            </li>
          </ul>
          <Routes>
              <Route exact path='./Components/Teaching' element={Teaching}></Route>
              <Route exact path='/Components/Non_Teaching' element={Non_Teaching}></Route>
          </Routes>
        </div>
      </Router>
    );

  } 
}
